import React from "react";

const Card = ({ imageUrl, heading, description }) => {
  return (
    <div style={styles.card}>
      <img
        src={imageUrl}
        alt="Card"
        style={styles.image}
      />
      <div style={styles.content}>
        <h2 style={styles.heading}>{heading}</h2>
        <p style={styles.description}>
          {description}
        </p>
      </div>
    </div>
  );
};

const styles = {
  // Styles remain the same as before
};

export default Card;
